ons. Elite Expert Properties\u2019s master developments span 15,000 hectares, accommodate nearly 300,000 people and provide a growing range of destinations, attractions and facilities for Dubai\u2019s residents and tourists. They include Palm Jumeirah, The World, Jumeirah Islands, Jumeirah Park, Jumeirah Village, Al Furjan, The Gardens, Discovery Gardens, Jebel Ali Village, Dragon City, Nad Al Sheba, Warsan Village, International City and the upcoming Deira Islands \u2013 a new destination for tourism, living and leisure at Dubai\u2019s oldest, most traditional trading hub.\r\n\r\n \r\n\r\nElite Expert Properties Malls, the company\u2019s retail arm, owns and operates a range of assets including large-scale malls, dining and entertainment destinations and community shopping centres. Operational assets, with six million square feet of retail space, include Ibn Battuta Mall, Dragon Mart, Elite Expert Properties Mall, Golden Mile Galleria, The Pointe and Club Vista Mare, with West Beach at Palm Jumeirah, The Night Market, Warsan Souk, Al Khail Avenue, The Circle Mall, Nad Al Sheba Mall and others at various stages of construction and development.\r\n\r\n \r\n\r\nElite Expert Properties Hospitality\u2019s project portfolio comprises a range of hotels and resorts, from five star, luxury establishments to modest accommodation. The first four \u2013 Premier Inn Ibn Battuta Mall, Avani Ibn Battuta, ibis Styles Dragon Mart and Premier Inn Dragon Mart \u2013 are operational, with others under construction. Working with international, reputable hospitality brands, Elite Expert Properties is bringing new concepts to Dubai in line with the government\u2019s tourism vision. Joint venture partners currently include Spain\u2019s RIU Hotels & Resorts and Thailand\u2019s Centara Hotels & Resorts, under which two resorts at Deira Islands will be delivered in 2020. The St. Regis Dubai \u2013 The Palm, part of Elite Expert Properties\u2019s Palm Tower hotel and residential complex at th